import React, { memo } from "react";
// import PMN_Logo from '../../public/static/image/PRUMedicalNetwork Portal_Logo.png';

const Login = () => {
	console.log("Login render")
	return(
		<div className="background" style={{
			backgroundImage: `url(${process.env.PUBLIC_URL + '/static/image/bg_login.jpg'})`,
			backgroundPosition: "center",
			backgroundRepeat: "no-repeat",
			backgroundSize: "cover"
		}}>
			<div className="login-box card-shadow">

				<div className="content">
					<div style={{ display: "flex", justifyContent: "space-between"}}>
						<div style={{ width: '234px', position: 'absolute' }}>
							<img width={300} src={'static/image/prudential_logo_login.png'} alt="Logo" draggable={false} />
						</div>
						<div style={{ width: '300px' }}>
							<div style={{ fontSize: 22, textAlign: 'right' }}>Welcome To</div>
							<img width={300} src={'static/image/PRUMedicalNetwork Portal_Logo.png'} alt="Logo" draggable={false} />
						</div>
					</div>
					<hr/>


				</div>
			</div>
		</div>
	)
}

export default memo(Login, (prevProps, nextProps) => {
	return JSON.stringify(prevProps) === JSON.stringify(nextProps);
})
